import React from "react";

const AdminProjects = () => {
  return (
    <div>
      <h2 className="text-2xl font-semibold text-textDark mb-4">Rebuilding Projects</h2>
      <p className="text-gray-500 italic">Project management tools coming soon...</p>
    </div>
  );
};

export default AdminProjects;
